import React from "react";
import { useNavigate } from "react-router-dom";
import { FiLogOut, FiSettings } from "react-icons/fi";

export default function Home({ onLogout }) {
  const navigate = useNavigate();
  return (
    <div style={{
      minHeight: "100vh",
      background: "linear-gradient(120deg,#101824 0%,#1c2740 100%)",
      color: "#fff",
      fontFamily: "Segoe UI, Inter, Arial, sans-serif",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      paddingTop: 44,
    }}>
      <div style={{ position: "absolute", right: 25, top: 25, display: "flex", gap: 16 }}>
        <button
          onClick={() => navigate("/configuracoes")}
          style={{
            background: "#121e38", border: "none", borderRadius: 9, padding: 9,
            color: "#0eb8d0", fontSize: 24, cursor: "pointer"
          }}
          title="Configurações"
        >
          <FiSettings />
        </button>
        <button
          onClick={onLogout}
          style={{
            background: "#121e38", border: "none", borderRadius: 9, padding: 9,
            color: "#ff7c7c", fontSize: 24, cursor: "pointer"
          }}
          title="Sair"
        >
          <FiLogOut />
        </button>
      </div>
      <img src="/venoai-logo.png" alt="VENO.AI" style={{ width: 85, marginBottom: 14, filter: "drop-shadow(0 3px 10px #00e0ff55)" }}/>
      <h2 style={{ fontSize: 28, fontWeight: 700, letterSpacing: 1, marginBottom: 0 }}>Gerador de Laudos Doppler Vascular</h2>
      <div style={{ margin: "22px 0 28px", fontSize: 15, color: "#abfaff" }}>
        Selecione o tipo de exame para continuar:
      </div>
      <div style={{
        display: "flex",
        flexDirection: "column",
        gap: 22,
        width: "100%",
        maxWidth: 420,
        alignItems: "center",
      }}>
        <MenuButton label="MMII Venoso" cor="#0eb8d0" onClick={() => navigate("/mmii-venoso")} />
        <MenuButton label="MMII Arterial" cor="#11b581" onClick={() => navigate("/mmii-arterial")} />
        <MenuButton label="MMSS Venoso" cor="#365cff" onClick={() => navigate("/mmss-venoso")} />
        <MenuButton label="MMSS Arterial" cor="#ff7c7c" onClick={() => navigate("/mmss-arterial")} />
        <MenuButton label="Carótidas e Vertebrais" cor="#ad73ff" onClick={() => navigate("/carotidas-vertebrais")} />
        <MenuButton label="Aorta e Ilíacas" cor="#ffd44e" onClick={() => navigate("/aorta-iliacas")} />
        <MenuButton label="Artérias Renais" cor="#ff8a2a" onClick={() => navigate("/arterias-renais")} />
      </div>
    </div>
  );
}

function MenuButton({ label, cor, onClick }) {
  return (
    <button
      onClick={onClick}
      style={{
        width: "100%",
        maxWidth: 330,
        background: cor,
        color: "#232f4e",
        fontWeight: 700,
        fontSize: 19,
        padding: "17px 0",
        border: "none",
        borderRadius: 14,
        cursor: "pointer",
        letterSpacing: 1,
        boxShadow: "0 2px 14px #00e0ff25",
        transition: ".2s"
      }}
    >
      {label}
    </button>
  );
}
